제작보고회 요원느 영상 만든 거 다 여기에 모아뒀습니당
@fire_toru 님의  그래  가족 제작보고회 요원시 모음

https://twitter.com/i/moments/824835523462074372 …

[직캠]170209 엘조 영화 '그래 가족' 레드카펫행사 by 김이모
@ljoeljoe1123 #엘조 #틴탑 #코엑스 #메가박스 #영화그래가족
https://youtu.be/gbnKd5RN1rk

너므화나서.. 그래 가족이 힘드니까 내가 땡겨쓸수있음 써야지..생각했는데 정말 등신같고 없다고 빼애앧했어야했음;;
내 피같은돈은 가족공용이고 시발새끼200은 지돈임??너무하지않음??;;

이번에도 돈한푼없이 걍 갔음..하
